INSERT INTO `news` VALUES (153,138286,1526567021,'Developers Improve HTML5 Gaming Industry, Add Blockchain','https://www.newsbtc.com/2018/05/17/developers-improve-html5-gaming-industry-add-blockchain/','Egretia partnered with Egret Technologies to create the world’s first HTML5 blockchain platform with functionality for developers, users, content publishers, and advertisers. The blockchain is needed to solve ongoing issues within the HTML5 industry. To make the new platform work, Egretia leverages Egret software with access to two hundred thousand developers and one billion users....The post Developers Improve HTML5 Gaming Industry, Add Blockchain appeared first on NewsBTC.','Sponsored','Blockchain|Technology|Sponsored'),(154,138285,1526565657,'Twitter CEO Jack Dorsey: Bitcoin Should Be Native Currency of the Internet','https://bitcoinist.com/ceo-of-twitter-and-square-has-expressed-positive-views-for-cryptocurrencies/','On Wednesday, Jack Dorsey, the CEO of Twitter and the Square payment company expressed his positive cryptocurrency sentiment as he stood on stage at the Consensus conference, saying that Bitcoin should be the cryptocurrency of the internet. Jack Dorsey: Cryptocurrency Evangelist Twitter has long been a platform that has been centric for cryptocurrency users and organizations. It quickly became a way in which crypto-related entities could convey announcements and talk about cryptocurrencies with members ofRead MoreThe post Twitter CEO Jack Dorsey: Bitcoin Should Be Native Currency of the Internet appeared first on Bitcoinist.com.','Bitcoin|Bitcoin Acceptance|Bitcoin Businesses|Companies|Conferences|News|News teaser|bitcoin|bitcoin acceptance|Consensus|Cryptocurrency|exchange|Jack Dorsey|Square|twitter','BTC|Exchange'),(155,138283,1526565627,'PayPal CFO: Merchants Aren’t Interested in Cryptocurrency, Volatility to Blame','http://www.livebitcoinnews.com/paypal-cfo-merchants-arent-interested-in-cryptocurrency-volatility-to-blame/','The CFO of PayPal has said that merchants aren&#8217;t interested in accepting cryptocurrency for payments because of its volatile nature. Appearing on CNBC&#8217;s &#8216;Mad Money&#8216; with host Jim Cramer, John Rainey, the chief financial officer of the online payments company, said: &#8220;If you&#8217;re a merchant and you have, let&#8217;s say, a 10 percent margin on a...The post PayPal CFO: Merchants Aren&#8217;t Interested in Cryptocurrency, Volatility to Blame appeared first on Bitcoin Network, News, Charts, Guides &amp; Analysis.','News|cryptocurrency|Jim Cramer|Mad Money|PayPal','BTC|Market'),(156,138284,1526565607,'What Are Civic’s ID Codes?','https://themerkle.com/what-are-civics-id-codes/','There are a lot of ways to implement blockchain technology. Civic is planning to do things especially differently with its ID Codes venture. This project will establish blockchain-powered verified relationships. It&#8217;s an important step toward ending scams in the blockchain and cryptocurrency world, although it may not be the end-all, be-all solution. Explaining ID Codes As the name somewhat suggests, Civic&#8217;s ID codes are designed to offer decentralized identity verification which both consumers and corporations can use with relative ease. This is a positive step toward proving business relationships in a transparent and immutable manner. No longer will there be any scams','Education|FAQ|blockchain|Civic|cryptocurrency|ID Codes','Blockchain|Technology|Business'),(157,138282,1526565368,'Press Release: Blackmoon, Nousplatform, ICONOMI and Melonport Disrupting Traditional Investment','https://www.trustnodes.com/2018/05/17/press-release-blackmoon-nousplatform-iconomi-melonport-disrupting-traditional-investment','The intensive development of the cryptoeconomy opened up a wide set of options for new types of investments. The acquisition of cryptocurrencies and tokens of ICO projects have become a...The post Press Release: Blackmoon, Nousplatform, ICONOMI and Melonport Disrupting Traditional Investment appeared first on Trustnodes.','Press Release','ICO|Sponsored'),(158,138281,1526565173,'Bithumb of South Korea Setting Up in London','https://www.financemagnates.com/cryptocurrency/news/bithumb-south-korea-setting-london/','\"Bitsum is preparing to advance to Europe.\"','News|bithumb|cryptocurrency|exchange|GMO Internet|Huobi|london|south-korea','Exchange|Asia'),(159,138279,1526564489,'Bitcoin Mining Could Use 0.5% of World’s Electricity Energy in 2018','https://www.ccn.com/bitcoins-electricity-usage-could-power-all-of-austria-in-the-future/','A recently released peer-reviewed article by blockchain evangelist and financial economist Alex de Vries deployed a novel methodology to determine Bitcoin’s energy usage a few years from now, and the estimated results are certainly astonishing. Pay with Bitcoin or Power a Home? Published on May 16 on Joule,  de Vries made use of complex economicThe post Bitcoin Mining Could Use 0.5% of World&#8217;s Electricity Energy in 2018 appeared first on CCN','Bitcoin Mining|Mining|News|Alex de Vries','BTC|Mining|Blockchain'),(160,138278,1526564433,'Bitfinex Starts Sharing Customer Tax Data with Authorities','https://news.bitcoin.com/bitfinex-starts-sharing-customer-tax-data-with-authorities/','Bitfinex, an exchange famed for its opaque banking arrangements, has begun ordering its users to submit their tax details. The platform, which is registered in the British Virgin Islands, a known tax haven, will retain this information and may share it with tax authorities in their customers’ jurisdiction. The news has caused quite a stir. [&#8230;]The post Bitfinex Starts Sharing Customer Tax Data with Authorities appeared first on Bitcoin News.','Exchanges|bitcoin tax|BitFinex|Coinbase|Compliance|KYC|N-Featured|offshore|Tax|Tax Haven|Tether|virgin islands','Regulation|Exchange|BTC|USDT'),(161,138277,1526563849,'DIWtoken.com: The all-in-one solution for a secure digital identity','https://themerkle.com/diwtoken-com-the-all-in-one-solution-for-a-secure-digital-identity/','After a successful Pre-ICO where we achieved the goal of reaching our soft cap, all our DIW team’s hard work so far, has been leading up to our current ICO. The developers are working hard to design the prototype which will be released during the 2nd quarter of 2018 and the management team are doing their utmost to ensure the best exchanges for the DIW token to be listed on after the ICO. We are currently in phase 2 of our highly anticipated ICO and we are offering a 19% bonus, in relation to the last ICO Phase, available only until the 17th of May 12:00','Sponsored|diw','ICO|Sponsored'),(162,138271,1526562059,'What Are Docademic and Medical Token Cryptocurrency?','https://themerkle.com/what-are-docademic-and-medical-token-cryptocurrency/','It is estimated that the global healthcare market processes fiat transactions that range between $1–2 trillion on a day-to-day basis. The crypto sector is comparatively smaller, as its daily transaction volume stands at around $2 billion. While there are more than 55 countries across the globe that provide their citizens with universal healthcare, there are still more than 100 nations that don&#8217;t offer universal or free healthcare infrastructure to their people. Docademic is an all-new globally-sourced healthcare service platform that is available to everyone. It makes use of a free-to-use human doctor-AI assisted video telemedicine service that has already been utilized in over 20 countries by','Education|FAQ|Docademic|Medical Token Cryptocurrency','Market|ICO|Fiat'),(163,138270,1526562037,'SEC Launches Fake Website to Educate Investors on ICO Risks','http://www.livebitcoinnews.com/sec-launches-fake-website-to-educate-investors-on-ico-risks/','The U.S. Securities and Exchange Commission (SEC) has launched a fake initial coin offering (ICO) website in a bid to educate would-be investors on the risks scam ICOs pose. In an announcement from the agency, the SEC has set up a website, HoweyCoins.com, that copies a bogus coin offering designed to educate investors on the...The post SEC Launches Fake Website to Educate Investors on ICO Risks appeared first on Bitcoin Network, News, Charts, Guides &amp; Analysis.','ICO|News|ICOs|Scam Website|SEC|STOs','ICO|Regulation|Business|BTC|Exchange'),(164,138273,1526562026,'Blockchain Technology is Shaping the Future of Shipping','https://bitcoinist.com/blockchain-technology-shaping-future-shipping/','Blockchain technology is in the process of revolutionizing the FinTech, real estate, and other industries, but it is also prepared to disrupt the supply chain. The shipping industry, while it keeps the global economy afloat, is riddled with inefficiency that directly impacts businesses and consumers. Shipping needs to move forward &#8211; so blockchain is just the push it needs. A Bit of History Before looking to the future, it’s essential to examine the past. DecadesRead MoreThe post Blockchain Technology is Shaping the Future of Shipping appeared first on Bitcoinist.com.','Altcoin News|Blockchain Technology|News|News teaser|Sponsored Article|blockchain technology|cargo logistics|FR8 Network|Freight|shipping','Blockchain|Technology'),(165,138272,1526562000,'Tronix Price Analysis - May 17','https://www.cryptoglobe.com/latest/2018/05/tronix-price-analysis-may-17/','Tronix returns to the range in the short-term. The bears&#39; momentum that pushed the price down to the $0.06300 demand area was lost after attempts for a further down move were rejected.','','TRX|Trading|Market'),(166,138269,1526561785,'SEC Launches Parody ICO, Clayton to Resign When?','https://www.trustnodes.com/2018/05/17/sec-launches-parody-ico-clayton-resign','The Securities and Exchanges Commission (SEC) has decided to engage in some propaganda against its own citizens by in effect ridiculing ICOs under the guise of educating. The website named...The post SEC Launches Parody ICO, Clayton to Resign When? appeared first on Trustnodes.','Editoria